const defaultState = {
    count: 210,
    blocked: false
}

export const countReducer = (state = defaultState, action) => {
  switch (action.type) {
    case "ADD_1":
      return {...state, count: state.count + action.payload};
    case "SET_COUNT":
      return {...state, count: 0 + Number(action.payload)};
    case "BLOCK_COUNTER":
      return {...state, count: 210};
    default:
      return state;
  }
}
